export default {
  "title": "CloudPanel | Documentation",
  "tagline": "CloudPanel | Documentation",
  "url": "https://www.cloudpanel.io",
  "baseUrl": "/docs/v2/",
  "favicon": "img/favicon.png",
  "onBrokenLinks": "throw",
  "organizationName": "CloudPanel",
  "projectName": "CloudPanel",
  "themeConfig": {
    "colorMode": {
      "disableSwitch": true,
      "defaultMode": "light",
      "respectPrefersColorScheme": false,
      "switchConfig": {
        "darkIcon": "ðŸŒœ",
        "darkIconStyle": {},
        "lightIcon": "ðŸŒž",
        "lightIconStyle": {}
      }
    },
    "gtag": {
      "trackingID": "UA-168148528-1"
    },
    "prism": {
      "theme": {
        "plain": {
          "color": "#393A34",
          "backgroundColor": "#f6f8fa"
        },
        "styles": [
          {
            "types": [
              "comment",
              "prolog",
              "doctype",
              "cdata"
            ],
            "style": {
              "color": "#999988",
              "fontStyle": "italic"
            }
          },
          {
            "types": [
              "namespace"
            ],
            "style": {
              "opacity": 0.7
            }
          },
          {
            "types": [
              "string",
              "attr-value"
            ],
            "style": {
              "color": "#e3116c"
            }
          },
          {
            "types": [
              "punctuation",
              "operator"
            ],
            "style": {
              "color": "#393A34"
            }
          },
          {
            "types": [
              "entity",
              "url",
              "symbol",
              "number",
              "boolean",
              "variable",
              "constant",
              "property",
              "regex",
              "inserted"
            ],
            "style": {
              "color": "#36acaa"
            }
          },
          {
            "types": [
              "atrule",
              "keyword",
              "attr-name",
              "selector"
            ],
            "style": {
              "color": "#00a4db"
            }
          },
          {
            "types": [
              "function",
              "deleted",
              "tag"
            ],
            "style": {
              "color": "#d73a49"
            }
          },
          {
            "types": [
              "function-variable"
            ],
            "style": {
              "color": "#6f42c1"
            }
          },
          {
            "types": [
              "tag",
              "selector",
              "keyword"
            ],
            "style": {
              "color": "#00009f"
            }
          }
        ]
      }
    },
    "navbar": {
      "logo": {
        "alt": "CloudPanel CE | Documentation",
        "src": "img/logo.svg",
        "href": "https://www.cloudpanel.io/docs/v2/introduction",
        "target": "_self"
      },
      "items": [],
      "hideOnScroll": false
    },
    "footer": {
      "style": "light",
      "links": [
        {
          "title": "Product",
          "items": [
            {
              "label": "Overview",
              "href": "https://www.cloudpanel.io/product/"
            },
            {
              "label": "Technology",
              "href": "https://www.cloudpanel.io/product/#technology-stack"
            },
            {
              "label": "Features",
              "href": "https://www.cloudpanel.io/product/#features"
            }
          ]
        },
        {
          "title": "Support",
          "items": [
            {
              "label": "Documentation",
              "href": "https://www.cloudpanel.io/docs/"
            },
            {
              "label": "Stack Overflow",
              "href": "https://stackoverflow.com/questions/tagged/cloudpanel"
            },
            {
              "label": "Discord",
              "href": "https://discord.cloudpanel.io"
            }
          ]
        },
        {
          "title": "Connect",
          "items": [
            {
              "label": "Github",
              "href": "https://github.com/cloudpanel-io/"
            },
            {
              "label": "Discord",
              "href": "https://discord.cloudpanel.io/"
            },
            {
              "label": "Linkedin",
              "href": "https://www.linkedin.com/company/mgt-commerce-gmbh"
            },
            {
              "label": "Twitter",
              "href": "https://twitter.com/cloudpanel_io"
            }
          ]
        },
        {
          "title": "Company",
          "items": [
            {
              "label": "About Us",
              "to": "https://www.cloudpanel.io/about-us/"
            },
            {
              "label": "Contact Us",
              "href": "https://www.cloudpanel.io/contact/"
            },
            {
              "label": "Feedback",
              "href": "https://www.cloudpanel.io/feedback/"
            },
            {
              "label": "Blog",
              "href": "https://www.cloudpanel.io/blog/"
            }
          ]
        },
        {
          "title": "Legal",
          "items": [
            {
              "label": "Imprint",
              "href": "https://www.cloudpanel.io/imprint/"
            },
            {
              "label": "License Terms",
              "to": "https://www.cloudpanel.io/license-terms/"
            },
            {
              "label": "Privacy Policy",
              "to": "https://www.cloudpanel.io/privacy-policy/"
            },
            {
              "label": "GDPR",
              "to": "https://www.cloudpanel.io/gdpr/"
            }
          ]
        }
      ],
      "copyright": "Copyright Â© 2021 cloudpanel.io"
    },
    "metadatas": []
  },
  "presets": [
    [
      "@docusaurus/preset-classic",
      {
        "docs": {
          "routeBasePath": "/",
          "sidebarPath": "/mnt/PhpstormProjects/cloudpanel-docs/v2/sidebars.js",
          "editUrl": "https://github.com/cloudpanel-io/docs/tree/master/cloudpanel-ce"
        },
        "theme": {
          "customCss": "/mnt/PhpstormProjects/cloudpanel-docs/v2/src/css/custom.css"
        }
      }
    ]
  ],
  "plugins": [
    "/mnt/PhpstormProjects/cloudpanel-docs/v2/node_modules/docusaurus-lunr-search/src/index.js"
  ],
  "onDuplicateRoutes": "warn",
  "customFields": {},
  "themes": [],
  "titleDelimiter": "|"
};
